import React from 'react';
import './Main.css';

const Main = () => (
    <main>
        <div className="container">
            <div className="block-form">
                <h2>Cadastro</h2>
                <input type="text" className="form-control" />
            </div>
        </div>
    </main>
);

export default Main;
